import React, { Component } from "react";
import { Badge } from "antd";

export class NoWrapper extends Component {
  render() {
    return (
      <div>
        <Badge count={25} />
        <Badge
          count={4}
          style={{
            backgroundColor: "#fff",
            color: "#999",
            boxShadow: "0 0 0 1px #d9d9d9 inset"
          }}
        />
        <Badge count={109} style={{ backgroundColor: "#52c41a" }} />
      </div>
    );
  }
}

export default NoWrapper;
